import React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { DrawerContent } from './DrawerContent';
import HomeScreen from './../../../views/HomeScreen';
import SettingsScreen from './../../../views/SettingsScreen';

const Drawer = createDrawerNavigator();

const drawerMenu = [{ name:'Drawer1', component: HomeScreen },
                    { name:'Drawer2', component: SettingsScreen },
                    { name:'Drawer3', component: HomeScreen }];

export default function DrawerNavigation() {
  return (
    <Drawer.Navigator initialRouteName="Home" 
      drawerContent={props=><DrawerContent {...props}/>}
      drawerStyle={{
        backgroundColor: '#eee',
        width: 240,
      }}
      drawerContentOptions={{activeTintColor:'#000',activeBackgroundColor:'#eee'}}
      >
        {drawerMenu.map((drawer)=>{
          return <Drawer.Screen name={drawer.name} component={drawer.component} />
        })}
    </Drawer.Navigator>
  );
}
